import React from 'react'

const DataDropTarget = (props) => {
  if (props.data) {
    return (<div className="data-drop-target" data-drop-target='true' id={props.id}>
      {props.data.map(i => i.name)}
    </div>)
  }
  else {
    return (<div className="data-drop-target" data-drop-target='true' id={props.id}>
    </div>)
  }
}

export default DataDropTarget
